using BackEnd.Data;
using BackEnd.Model;
using Microsoft.AspNetCore.Authorization;
using Microsoft.AspNetCore.Mvc;
using Microsoft.EntityFrameworkCore;
using System;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace BackEnd.Controllers
{
    [Route("api/animalBreedInfo")]
    [ApiController]
    public class animalBreedInfo : ControllerBase
    {
        private readonly ModelContext _context;
        private readonly IJwtAuthenticationHandler _jwtAuthenticationHandler;
        //构造函数注入生成token的类

        public animalBreedInfo(ModelContext context, IJwtAuthenticationHandler jwtAuthenticationHandler)
        {
            _context = context;
            _jwtAuthenticationHandler = jwtAuthenticationHandler;
        }

        /*--------------------------------------------
         * 函数名：getpregnent
         * API：47.118.78.110:8088/api/animalBreedInfo/getpregnent
         * 参数：null
         * 功能：获取繁殖信息
         * 权限：仅员工
         --------------------------------------------*/
        [Authorize(Policy = "EmployeePolicy")]
        [HttpGet("getpregnent/")]
        public async Task<ActionResult<backdata>> getpregnent()
        {
            backdata result = new backdata();
            var birth = await _context.Births.ToListAsync();

            if (birth == null)
            {
                return NotFound();
            }

            result.data = birth;
            return result;
        }

        /*--------------------------------------------
         * 函数名：createBirthInfo
         * API：47.118.78.110:8088/api/animalBreedInfo/createBirthInfo
         * 参数：string? ani_id, DateTime? time, bool? success, byte? children_num
         * 功能：创建繁殖信息
         * 权限：仅员工
         --------------------------------------------*/
        [Authorize(Policy = "EmployeePolicy")]
        [HttpPost("createBirthInfo/")]
        public async Task<ActionResult<backdata>> PostBirth(string? ani_id, DateTime? time, bool? success, byte? children_num)
        {
            backdata result = new backdata();
            Birth birth = new Birth();
            if (ani_id == null || time == null || children_num == 0)
            {
                result.code = 400;
                result.message = "缺少必要信息";
                return result;
            }

            birth.Id = ani_id;
            birth.Time = time;
            birth.Success = success;
            birth.ChildrenNum = children_num;

            _context.Births.Add(birth);
            try
            {
                await _context.SaveChangesAsync();
            }
            catch (DbUpdateException)
            {
                if (BirthExists(birth.Id))
                {
                    result.code = 400;
                    result.message = "新增信息重复";
                    Conflict();
                }
                else
                {
                    throw;
                }
            }

            result.data = birth;
            return result;
        }

        /*--------------------------------------------
         * 函数名：createInfo
         * API：47.118.78.110:8088/api/animalBreedInfo/createInfo
         * 参数：Animal animal
         * 功能：配置新诞生动物信息
         * 权限：仅员工
         --------------------------------------------*/
        [Authorize(Policy = "EmployeePolicy")]
        [HttpPost("createInfo/")]
        public async Task<ActionResult<backdata>> createInfo(Animal animal)
        {
            {
                backdata result = new backdata();
                if (animal.Id == null || animal.Species == null || animal.Name == null || animal.Gender == null || animal.PhysicalCondition == null || animal.BreedSituation == null)
                {
                    result.code = 400;
                    result.message = "缺少必要信息";
                }
                else
                {
                    if (animal.Photo == null) animal.Photo = Encoding.Default.GetBytes("");
                    _context.Animals.Add(animal);
                    try
                    {
                        await _context.SaveChangesAsync();
                    }
                    catch (DbUpdateException)
                    {
                        if (AnimalExists(animal.Id))
                        {
                            result.code = 400;
                            result.message = "新增动物ID重复";
                            Conflict();
                        }
                        else
                        {
                            throw;
                        }
                    }
                }
                result.data = animal;
                return result;
            }
        }

        private bool AnimalExists(string id)
        {
            return _context.Animals.Any(e => e.Id == id);
        }

        private bool BirthExists(string id)
        {
            return _context.Births.Any(e => e.Id == id);
        }
    }
}
